extern SLAVE_FUN(fft_func_init)(void* arg);
extern SLAVE_FUN(fft_func_proc)(void* arg);
extern SLAVE_FUN(fft_func_test)(void* arg);

double rpcc()
{
	struct timeval t;
	gettimeofday(&t, NULL);
	return (double)t.tv_sec + t.tv_usec * 1e-6;  
}

void fft_process_init(void* step)
{
	athread_spawn64(slave_fft_func_init);
	athread_join64();
}

void fft_process_normal(void* c)
{
	athread_spawn64(slave_fft_func_proc);
	athread_join64();
}

void fft_process_test(void* step)
{
	athread_spawn64(slave_fft_func_test,(void*) step);
	athread_join64();
}

int main(int argc, char *argv[])
{
	double st,ed;
	int proc_id = 0;
	int i = 0;
	int ret = RET_ERR;
	char buffer[BUFFER_SIZE];
	FILE* fp = NULL;
	//malloc array
	FFT_TYPE *OutputBuf = (FFT_TYPE *)malloc(N * sizeof(FFT_TYPE)); 
	FFT_TYPE *InputBuf = (FFT_TYPE *)malloc(N * sizeof(FFT_TYPE));
	
	if (1 == N)
	{
		printf("The length of input is too short. [%d]", N);
		return RET_ERR;
	}
	
	
	if ((NULL == OutputBuf) || (NULL == InputBuf))
	{
		printf("malloc array fail!\n");
		return RET_ERR;
	}

	// 数据初始化
	for ( ; i < N; ++i)
	{
		InputBuf[i].re = i;
		InputBuf[i].im = i;
	}
	
	athread_init();
	athread_enter64();
	
	st = rpcc();
	// 进行计算
	ret = fft_cal(InputBuf, OutputBuf, N, N);
	ed = rpcc();

	if (RET_OK == ret)
		printf("proc: %d, st and ed: %.6f, %.6f, %.6f\n", proc_id, st, ed, ed - st);
	else
		return ret;

	athread_leave64();
	athread_halt();

	// 文本输出单行输出
#ifdef DEBUG_FILE_OPEN
    sprintf(buffer, "./output_%d", proc_id);
    fp = fopen(buffer, "w");
	if (NULL != fp)
	{
		for (i = 0; i < N; ++i)
		{
			sprintf(buffer, "data %d: %f, %f.\n", i, OutputBuf[i].re, OutputBuf[i].im);
			fwrite(buffer, strlen(buffer),1, fp);
		}

		fclose(fp);
	}
#endif
	
	free(InputBuf);
	free(OutputBuf);
	
	return RET_OK;
}

int inverse_transpose(FFT_TYPE* in, FFT_TYPE* out, unsigned int in_length, unsigned int out_length, FFT_STEP* step)
{
	unsigned int len = 0;
	unsigned int max = 0;
	unsigned int num = 0;
	unsigned int ivs = 0;
	unsigned int index = 0;
	unsigned int index1 = 0;
	unsigned int base = 0;
	unsigned int base1 = 0;

	int i = 0;
	int j = 0;

	// 合法性检查
	if ((NULL == in) || (NULL == step) || (NULL == out))
		return RET_ERR;

	
    // 获取参数
	len =  step->rs;
	max =  step->circle_max;
	num =  step->circle_num / 2;
	ivs =  step->ivs * 2;
    for (j = 0; j < num; ++j)
    {
		base = j * max * 2;
	    for (i = 0; i < max; ++i)
	    {
			base1 = 2 * i + base;
            index1 = index + WS(i,len);

		    out[index1].re = in[base1].re;
		    out[index1].im = in[base1].im;

		    out[index1 + 1].re = in[base1 + 1].re;
		    out[index1 + 1].im = in[base1 + 1].im;

	    }

		index += ivs;
    }

	// 后半部分处理特殊处理不能整除的情况
	if (0 != (step->circle_num % 2))
	{
		base = j * max * 2;
		for (i = 0; i < max; ++i)
	    {
			base1 = 2 * i + base;
            index1 = index + WS(i,len);

		    out[index1].re = in[base1].re;
		    out[index1].im = in[base1].im;

		    out[index1 + 1].re = 0; // TODO
		    out[index1 + 1].im = 0;

	    }
	}

    return RET_OK;
}

/**************************************************************
    N=1000  20 ivs = 50 ovs = 40. The length of in and out buffer are same. 
    step = 1000 /2;
***************************************************************/
int transpose(FFT_TYPE* in,FFT_TYPE* out, unsigned int in_length, unsigned int out_length, FFT_STEP* step)
{
	unsigned int base = 0;
	unsigned int base1 = 0;
	unsigned int index = 0;
	unsigned int index1 = 0;
	unsigned int index2 = 0;
	unsigned int len = 0;
	unsigned int max = 0;
	unsigned int num = 0;
	unsigned int ivs = 0;
	
	int i = 0;
	int j = 0;
	
	// 合法性检查
	if ((NULL == in) || (NULL == step) || (NULL == out))
		return RET_ERR;

	
    // 获取参数
	len =  step->rs;
	max =  step->circle_max;
	num =  step->circle_num / 2;
	ivs =  step->ivs;

	base = 0;
	base1 = ivs;

	// 对于num不能整除的后面再考虑
    for (; j < num; ++j)
    {
		for (i = 0; i < max; ++i) // 使用simd指令，特殊处理
		{
			index1 = 2 * i + index2;
			
			index = base + WS(i,len);
		    out[index1].re = in[index].re;
			out[index1].im = in[index].im;

			index = base1 + WS(i,len);
			out[index1 + 1].re = in[index].re;
			out[index1 + 1].im = in[index].im;
		}

		base   += 2 * ivs;
		base1  += 2 * ivs;
		index2 += 2 * max;
    }
	
    // 对于不能整除的末尾加0
	if (0 != (step->circle_num % 2))
	{
		for (i = 0; i < max; ++i) // 使用simd指令，特殊处理
		{
			index1 = 2 * i + index2;
			
			index = base + WS(i,len);
		    out[index1].re = in[index].re;
			out[index1].im = in[index].im;

			out[index1 + 1].re = 0;
			out[index1 + 1].im = 0;
		}
	}

	
	return RET_OK;
}

/************************************************************************
           该函数计算N > 2000的点,其中result 为最终结果
           
 ************************************************************************/
int fft_cal(FFT_TYPE* in, FFT_TYPE* out, unsigned int in_length, unsigned int out_length)
{
	int ret;
	int cn = 0;
	int i;
	FFT_PARAM* param = &masterParam;
	FFT_STEP* step = NULL;
	FFT_TYPE* input = in;

	// 参数合法性检查
	if ((NULL == in) || (NULL == out))
		return RET_ERR;

	// 申请空间
	/*
	param = (FFT_PARAM*)malloc(sizeof(FFT_PARAM));
	if (NULL == param)
		return RET_ERR;
	*/
	FFT_TYPE* inner1 = NULL;
	FFT_TYPE* inner = (FFT_TYPE*)malloc(sizeof(FFT_TYPE) * N);
	if (NULL == inner)
		return;


	// 关键步骤生成参数，根据N计算相关参数20000
	param->current 				    = STEP_1;
	param->num1 				    = 2;
	param->num2 				    = 1;
	param->circle_num1 			    = 25;
	param->circle_num2              = 1;
	
	param->steps1[0].circle_num 	= 25; // 使用simd技术,不除以2，除不尽需要特殊处理
	param->steps1[0].circle_max 	= 32;
	param->steps1[0].rs	            = 1250 / 2;
	param->steps1[0].ivs 		    = 50 / 2;
	param->steps1[0].ovs 		    = 64 / 2;
	param->steps1[0].wrs            = 0;

	param->steps1[1].circle_num     = 32; // 使用simd技术
	param->steps1[1].circle_max     = 25;
	param->steps1[1].rs             = 64 / 2;
	param->steps1[1].ivs            = 2  / 2;
	param->steps1[1].ovs            = 64 / 2;
	param->steps1[1].wrs            = 8;

	param->steps2[0].circle_num	    = 800;
	param->steps2[0].circle_max 	= 25;
  param->steps2[0].rs 			= 1600 / 2;
	param->steps2[0].ivs			= 2  / 2;
	param->steps2[0].ovs			= 40 / 2;
	param->steps2[0].wrs            = 8;
		

	cn = param->circle_num1;

	FFT_TYPE* output1;
	FFT_TYPE* input1 = input;
		
	// 计算第一部分
    for (i = 0 ; i < cn; ++i)
    {
		masterParam.current = STEP_1;
		
		step = &param->steps1[masterParam.current];
		
		// 数据转置
		ret = transpose(input1, inner, in_length, out_length, step);
		if (RET_OK != ret)
		{
			free(inner);
			return RET_ERR;
		}

		step->input = inner;
		output1 = out + i * step->circle_num * step->circle_max; // TODO
		step->output = output1;

		if (0 == i)
			fft_process_init(step);
		else
			fft_process_normal(&masterParam.current);
		
		masterParam.current = STEP_2;

		step = &param->steps1[masterParam.current];
		ret = transpose(output1, inner, in_length, out_length, step);
		if (RET_OK != ret)
		{
			free(inner);
			return RET_ERR;
		}

		step->input = inner;
		step->output = inner;

		fft_process_normal((void *)&masterParam.current);

		//output1 = out + i * step->circle_num * step->circle_max * 2; // 有效数据存放在out偏移的部分
        ret = inverse_transpose(inner, output1, in_length, out_length, step);
		
		// TODO 数据在主核重新搬移一次搬移好的放到output1移动的位置
		++input1;
    }

	masterParam.current = STEP_3;
	cn = param->circle_num2;
	
	// 计算第二部分
	for (i = 0; i < cn; ++i)
	{
		step = &param->steps2[masterParam.current - param->num1];
		ret = transpose(out, inner, in_length, out_length, step);
		if (RET_OK != ret)
		{
			free(inner);
			return RET_ERR;
		}

		step->input = inner;
		step->output = inner;

		int j = 0;
		for (j = 0; j < 100; ++j)
		{
			printf("%d: %f, %f\n",j, inner[j].re, inner[j].im);
		}

		fft_process_normal(&masterParam.current);

		ret = inverse_transpose(inner, out, in_length, out_length, step);
		if (RET_OK != ret)
		{
			free(inner);
			return RET_ERR;
		}

		
	}

	// 释放空间
	free(inner);
	return RET_OK;
}

